CREATE FUNCTION public.countdishfromfood(v_name_food_s character varying, user_id_s integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	mi integer;
	ma integer;
	tgi integer;
	Dish_Id_vc integer;
	Dish_Id_mi integer;
	Dish_Id_ma integer;
	User_Id_Dish integer;
	Re_Count integer;
	tgs character varying;
BEGIN
	vc= (Select count(*) From "Food")::integer;
	mi = (Select min("Food_Id") From "Food")::integer;
	ma = (Select max("Food_Id") From "Food")::integer;
	Re_Count= 0;
	If (vc>0) Then
		While (1)
		Loop
			tgs = (Select "V_Name_Food" From "Food" Where "Food_Id"=mi)::character varying;
			tgi = (Select min("Food_Id") From "Food" Where "Food_Id">mi)::integer;
			If (upper(tgs) like '%'||upper(V_Name_Food_S)||'%') Then
				Dish_Id_vc= (Select count(*) From "Dish_Food" Where "Food_Id"=mi)::integer;
				Dish_Id_mi= (Select min("Dish_Id") From "Dish_Food" Where "Food_Id"=mi)::integer;
				Dish_Id_ma= (Select max("Dish_Id") From "Dish_Food" Where "Food_Id"=mi)::integer;
				If(Dish_Id_vc>0) Then
					While(1)
					Loop
						User_Id_Dish= (Select "User_Id" From "Dish" Where "Dish_Id"=Dish_Id_mi)::integer;
						If(User_Id_Dish=1 Or User_Id_Dish=User_Id_S) Then
							Re_Count= Re_Count + 1;
						End If;
						EXIT When Dish_Id_mi = Dish_Id_ma;
						Dish_Id_mi= (Select min("Dish_Id") From "Dish_Food" Where "Food_Id"=mi And "Dish_Id">Dish_Id_mi)::integer;
					End Loop;
				End If;
			End If;
			EXIT When mi = ma;
			mi = tgi;
		End Loop;
	End If;
	
	RETURN Re_Count;
END
$$;


