CREATE FUNCTION public.delfood(food_id_d integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	mi integer; mi_Us integer;
	ma integer; ma_Us integer;
BEGIN
	vc= (Select count(*) From "Dish_Food" Where "Food_Id"=Food_Id_D);
	mi= (Select min("Dish_Id") From "Dish_Food" Where "Food_Id"=Food_Id_D)::integer;
	ma= (Select max("Dish_Id") From "Dish_Food" Where "Food_Id"=Food_Id_D)::integer;
