--

CREATE FUNCTION public.delhistory_eat_dish(dish_d character varying, user_id_d integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	Str character varying;
BEGIN
	Dish_D= upper(Dish_D);
	Str= substring(Dish_D from 1 for 1);
	If (Str='U')
		Then
			Str= substring(Dish_D from 2 for char_length(Dish_D)-1 );
			Delete From "History_Eat_Dish" Where ("User_Id"=User_Id_D and "Dish_User_Add_Id"=Str::integer);
		Else
			Delete From "History_Eat_Dish" Where ("User_Id"=User_Id_D and "Dish_Id"=Dish_D::integer);
	End If;
END
$$;


