--
-- Name: nutrient_indate_var(integer, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.nutrient_indate_var(user_id_s integer, date_eat_s date) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	mi integer; ma integer;
	mi_Nu integer; ma_Nu integer;
	PoN integer; PoV integer;
	tgi integer; L_Re integer;
	value_hed real; value_d real; value_N real; value_P real;
	tgs character varying;
	Re character varying;
BEGIN
	vc = (Select count(*) From "History_Eat_Dish" 
		Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id" is not null) )::integer;

	Re= '';
	If (vc>0) Then
		mi = (Select min("Dish_Id") From "History_Eat_Dish" 
			Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id" is not null) )::integer;
		ma = (Select max("Dish_Id") From "History_Eat_Dish"
			Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id" is not null) )::integer;
		value_hed= (Select "Value_Dish" From "History_Eat_Dish" 
			Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id"=mi) )::real;
		value_d= (Select "Value_Dish" From "Dish" Where "Dish_Id"=mi)::real;
		mi_Nu = (Select min("Nutrients_Id") From "Dish_Nutrients" Where "Dish_Id"=mi)::integer;
		ma_Nu = (Select max("Nutrients_Id") From "Dish_Nutrients" Where "Dish_Id"=mi)::integer;
		While (1)
		Loop
			value_N= (Select "Value_Nutrients_Dish" From "Dish_Nutrients" Where ("Dish_Id"=mi and "Nutrients_Id"=mi_Nu) )::real;
			Re= Re || mi_Nu || ':' || (value_N*value_hed/value_d)::real || ';';
			
			EXIT When mi_Nu = ma_Nu;
			tgi= (Select min("Nutrients_Id") From "Dish_Nutrients" Where "Dish_Id"=mi and "Nutrients_Id">mi_Nu)::integer;
			mi_Nu = tgi;
		End Loop;

		While (ma>mi)
		Loop
			tgi= (Select min("Dish_Id") From "History_Eat_Dish" 
				Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id">mi) )::integer;
			mi= tgi;
			value_hed= (Select "Value_Dish" From "History_Eat_Dish" 
				Where ("User_Id"=User_Id_S and "Date_Time_Eat"::date=Date_Eat_S and "Dish_Id"=mi) )::real;
			value_d= (Select "Value_Dish" From "Dish" Where "Dish_Id"=mi)::real;

			L_Re= char_length(Re);
			tgs='';
			While(L_Re>0)
			Loop
				PoN= position(':' in Re); PoV= position(';' in Re);
				mi_Nu= substring(Re from 1 for (PoN-1))::integer;
				value_P= substring(Re from (PoN+1) for (PoV-PoN-1))::real;

				vc=(Select count(*) From "Dish_Nutrients" Where ("Dish_Id"=mi and "Nutrients_Id"=mi_Nu) )::integer;
				If(vc>0) Then
					value_N= (Select "Value_Nutrients_Dish" From "Dish_Nutrients" Where ("Dish_Id"=mi and "Nutrients_Id"=mi_Nu) )::real;
					tgs= tgs || mi_Nu || ':' || (value_P + value_N*value_hed/value_d)::real || ';';
				End If;

				Re= substring(Re from (PoV+1) for (L_Re-PoV) );
				L_Re= char_length(Re);
			End Loop;
			Re= tgs;
		End Loop;
	End If;

	RETURN Re;
END
$$;


