--
-- Name: s_nutrients_dish(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.s_nutrients_dish(dish_id_s integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	mi integer;
	ma integer;
	tgi integer;
	val real;
	Re character varying;
	tgs character varying;
BEGIN
	vc= (Select count(*) From "Dish_Nutrients" Where "Dish_Id"=Dish_Id_S)::integer;
	mi = (Select min("Nutrients_Id") From "Dish_Nutrients" Where "Dish_Id"=Dish_Id_S)::integer;
	ma = (Select max("Nutrients_Id") From "Dish_Nutrients" Where "Dish_Id"=Dish_Id_S)::integer;
	Re= '';
	If (vc>0) Then
		While (1)
		Loop
			tgs = (Select "Name_Nutrients" From "Nutrients" Where "Nutrients_Id"=mi)::character varying;
			val= (Select "Value_Nutrients_Dish" From "Dish_Nutrients" Where ("Dish_Id"=Dish_Id_S and "Nutrients_Id"=mi) )::real;
			Re= Re || tgs || ':' || val;
			tgs = (Select "Unit_Nutrients" From "Nutrients" Where "Nutrients_Id"=mi)::character varying;
			Re= Re || '-' || tgs || ', ';
			
			EXIT When mi = ma;
			tgi = (Select min("Nutrients_Id") From "Dish_Nutrients" Where ("Dish_Id"=Dish_Id_S and "Nutrients_Id">mi) )::integer;
			mi = tgi;
		End Loop;
	End If;

	RETURN Re;
END
$$;


