	vc = (Select count(*) From "Food_Nutrients_100g" 
		Where ("Food_Id"=Food_Id_S And "Nutrients_Id"=Nutrients_Id_S) )::integer;
	If(vc=0) Then Re=NULL;
		Else Re= (Select "Value_Nutrients_in100g_Food" From "Food_Nutrients_100g" 
			Where ("Food_Id"=Food_Id_S And "Nutrients_Id"=Nutrients_Id_S) )::real;
	End If;
	
	RETURN Re;
END
$$;


