--
-- Name: up1dish(character varying, integer, character varying, character varying, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.up1dish(name_dish_u character varying, cat_dish_id_u integer, foods_u character varying, nutrients_u character varying, user_id_u integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	ic integer;
	DId integer;
	DF_DN_Id integer;
	PoFN integer;
	PoV integer;
	L_FoN_N integer;
	FoN_Id_U integer;
	Value_U real;
	Value_S_U real;
	FoN_N character varying;
	Re boolean;
BEGIN
	Re= true;
	Value_S_U= 0;

	vc= (Select count(*) From "Cat_Dish" Where "Cat_Dish_Id"=Cat_Dish_Id_U);
	If(vc>0 and Name_Dish_U<>'' and Name_Dish_U Is Not null) Then
		DId= Cat_Dish_Id_U*1000 + 1;
		vc= (Select count(*) From "Dish" Where "Dish_Id"=DId);
		While(vc>0)
		  Loop
			DId= DId + 1;
			vc= (Select count(*) From "Dish" Where "Dish_Id"=DId);
		  End Loop;

		FoN_N = Foods_U;
		L_FoN_N= char_length(FoN_N);
		DF_DN_Id= 1;
		If(L_FoN_N>0) Then
			While(L_FoN_N>0)
			  Loop
				vc= (Select count(*) From "Dish_Food" Where "Dish_Food_Id"=DF_DN_Id);
				While(vc>0)
				  Loop
					DF_DN_Id= DF_DN_Id + 1;
					vc= (Select count(*) From "Dish_Food" Where "Dish_Food_Id"=DF_DN_Id);
				  End Loop;
				  
				PoFN= position(':' in FoN_N);
				PoV= position(';' in FoN_N);
				If(PoFN=0 or PoFN=1 or PoV=0 or PoV=PoFN+1) Then
					Re= false;
					Perform DelDish(DId);
					RETURN Re;
				End If;
				
				vc=1;
				While (vc<PoFN)
				  Loop
					If( ascii(substring(FoN_N from vc for 1))<48 or ascii(substring(FoN_N from vc for 1))>57 ) Then
						Re= false;
						Perform DelDish(DId);
						RETURN Re;
					End If;
					vc=vc+1;
				  End Loop;
				  
				vc=PoFN+1;
				ic=0;
				While (vc<PoV)
				  Loop
					If( ascii(substring(FoN_N from vc for 1))<>46 and (ascii(substring(FoN_N from vc for 1))<48 or ascii(substring(FoN_N from vc for 1))>57) ) Then
						Re= false;
						Perform DelDish(DId);
						RETURN Re;
					Else
						If ( ascii(substring(FoN_N from vc for 1))=46 ) Then
							ic=ic+1;
						End If;
						If (ic>1) Then
							Re= false;
							Perform DelDish(DId);
							RETURN Re;
						End If; 
					End If;
					vc=vc+1;
				  End Loop;
				
				FoN_Id_U = substring(FoN_N from 1 for (PoFN-1))::integer;
				Value_U = substring(FoN_N from (PoFN+1) for (PoV-PoFN-1))::real;
				Value_S_U= Value_S_U + Value_U;
				
				vc= (Select count(*) From "Food" Where "Food_Id"=FoN_Id_U);
				If(vc=0) Then
					Re= false;
					Perform DelDish(DId);
					RETURN Re;
				Else
				End If;
				FoN_N= substring(FoN_N from (PoV+1) for (L_FoN_N-PoV) );
				DF_DN_Id = DF_DN_Id + 1;
				L_FoN_N= char_length(FoN_N);
			  End Loop;
		Else
			Re= false;
			Perform DelDish(DId);
			RETURN Re;
		End If;

		Update "Dish" Set "Value_Dish"=Value_S_U Where "Dish_Id"=DId;

		FoN_N = Nutrients_U;
		L_FoN_N= char_length(FoN_N);
		DF_DN_Id= 1;
		While(L_FoN_N>0)
		  Loop
			vc= (Select count(*) From "Dish_Nutrients" Where "Dish_Nutrients_Id"=DF_DN_Id);
			While(vc>0)
			  Loop
				DF_DN_Id= DF_DN_Id + 1;
				vc= (Select count(*) From "Dish_Nutrients" Where "Dish_Nutrients_Id"=DF_DN_Id);
			  End Loop;
			PoFN= position(':' in FoN_N);
			PoV= position(';' in FoN_N);

			If(PoFN=0 or PoFN=1 or PoV=0 or PoV=PoFN+1) Then
				Re= false;
				Perform DelDish(DId);
				RETURN Re;
			End If;
			
			vc=1;
			While (vc<PoFN)
			  Loop
				If( ascii(substring(FoN_N from vc for 1))<48 or ascii(substring(FoN_N from vc for 1))>57 ) Then
					Re= false;
					Perform DelDish(DId);
					RETURN Re;
				End If;
				vc=vc+1;
			  End Loop;
			  
			vc=PoFN+1;
			ic=0;
			While (vc<PoV)
			  Loop
				If( ascii(substring(FoN_N from vc for 1))<>46 and (ascii(substring(FoN_N from vc for 1))<48 or ascii(substring(FoN_N from vc for 1))>57) ) Then
					Re= false;
					Perform DelDish(DId);
					RETURN Re;
				Else
					If ( ascii(substring(FoN_N from vc for 1))=46 ) Then
						ic=ic+1;
					End If;
					If (ic>1) Then
						Re= false;
						Perform DelDish(DId);
						RETURN Re;
					End If; 
				End If;
				vc=vc+1;
			  End Loop;
			
			FoN_Id_U = substring(FoN_N from 1 for (PoFN-1))::integer;
			Value_U = substring(FoN_N from (PoFN+1) for (PoV-PoFN-1))::real;

			vc= (Select count(*) From "Nutrients" Where "Nutrients_Id"=FoN_Id_U);
			If(vc=0) Then
				RE= false;
				Perform DelDish(DId);
				RETURN Re;
			Else
			End If;
			FoN_N= substring(FoN_N from (PoV+1) for (L_FoN_N-PoV) );
			DF_DN_Id = DF_DN_Id + 1;
			L_FoN_N= char_length(FoN_N);
		  End Loop;
	Else 
		Re=false;
	End If;

	RETURN Re;
END
$$;


ALTER FUNCTION public.up1dish(name_dish_u character varying, cat_dish_id_u integer, foods_u character varying, nutrients_u character varying, user_id_u integer) OWNER TO postgres;

