CREATE FUNCTION public.up1food(v_name_food_u character varying, e_name_food_u character varying, refuse_rate_u real, cat_food_id_u integer, nutrients_u character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	ic integer;
	FId integer;
	FN_Id integer;
	PoN integer;
	PoV integer;
	L_Nutrients_N integer;
	Nutrient_Id_U integer;
	Value_U real;
	Nutrients_N character varying;
	Re boolean;
BEGIN
	Re= true;

	vc= (Select count(*) From "Cat_Food" Where "Cat_Food_Id"=Cat_Food_Id_U);
	If(vc=0 or (Refuse_Rate_U<0 or Refuse_Rate_U>100 ) or V_Name_Food_U Is null or V_Name_Food_U='' ) Then
		Re= False;
		RETURN Re;
	End If;	
	
	Nutrients_N = Nutrients_U;
	FId= Cat_Food_Id_U*1000 + 1;
	vc= (Select count(*) From "Food" Where "Food_Id"=FId);
	While(vc>0)
	  Loop
		FId= FId + 1;
		vc= (Select count(*) From "Food" Where "Food_Id"=FId);
	  End Loop;
	L_Nutrients_N= char_length(Nutrients_N);
	FN_Id= 1;
	While(L_Nutrients_N>0)
	  Loop
		vc= (Select count(*) From "Food_Nutrients_100g" Where "Food_Nutrients_100g_Id"=FN_Id);
		While(vc>0)
		  Loop
			FN_Id= FN_Id + 1;
			vc= (Select count(*) From "Food_Nutrients_100g" Where "Food_Nutrients_100g_Id"=FN_Id);
		  End Loop;
		PoN= position(':' in Nutrients_N);
		PoV= position(';' in Nutrients_N);

		If(PoN=0 or PoN=1 or PoV=0 or PoV=PoN+1) Then
			Re= false;
			Perform DelFood(FId);
			RETURN Re;
		End If;
		
		vc=1;
		While (vc<PoN)
		  Loop
			If( ascii(substring(Nutrients_N from vc for 1))<48 or ascii(substring(Nutrients_N from vc for 1))>57 ) Then
				Re= false;
				Perform DelFood(FId);
				RETURN Re;
			End If;
			vc=vc+1;
		  End Loop;
		  
		vc=PoN+1;
		ic=0;
		While (vc<PoV)
		  Loop
			If( ascii(substring(Nutrients_N from vc for 1))<>46 and (ascii(substring(Nutrients_N from vc for 1))<48 or ascii(substring(Nutrients_N from vc for 1))>57) ) Then
				Re= false;
				Perform DelFood(FId);
				RETURN Re;
			Else
				If ( ascii(substring(Nutrients_N from vc for 1))=46 ) Then
					ic=ic+1;
				End If;
				If (ic>1) Then
					Re= false;
					Perform DelFood(FId);
					RETURN Re;
				End If; 
			End If;
			vc=vc+1;
		  End Loop;
		
		Nutrient_Id_U = substring(Nutrients_N from 1 for (PoN-1))::integer;
		Value_U = substring(Nutrients_N from (PoN+1) for (PoV-PoN-1))::real;
		Nutrients_N= substring(Nutrients_N from (PoV+1) for (L_Nutrients_N-PoV) );
		FN_Id = FN_Id + 1;
		L_Nutrients_N= char_length(Nutrients_N);
	  End Loop;

	RETURN Re;
END
$$;


