CREATE FUNCTION public.up1history_eat_dish(user_id_u integer, date_time_eat_u timestamp without time zone, dish_id_u integer, value_dish_u real) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	H_E_D_I_U integer;
	Re boolean;
BEGIN
	Re= true;

	vc= (Select count(*) From "User" Where "User_Id"=User_Id_U);
	If(vc>0) Then
		If(Value_Dish_U<=0 Or Date_Time_Eat_U IS null) Then
			vc=0;
		Else
			If(Dish_Id_U IS NOT null) Then
				vc= (Select count(*) From "Dish" Where "Dish_Id"=Dish_Id_U and ("User_Id"=1 or "User_Id"=User_Id_U) );
			Else
				vc=0;
			End If;
		End If;
	End If;
	
	If (vc=0) Then
		Re= false;
		RETURN Re;
	End If;
	
	H_E_D_I_U = 1;
	vc= (Select count(*) From "History_Eat_Dish" Where "History_Eat_Dish_Id"=H_E_D_I_U);
	While(vc>0)
	  Loop
		H_E_D_I_U= H_E_D_I_U + 1;
		vc= (Select count(*) From "History_Eat_Dish" Where "History_Eat_Dish_Id"=H_E_D_I_U);
	  End Loop;

	RETURN Re;
END
$$;


