--

CREATE FUNCTION public.up1user(account_u character varying, hash_pass_u character varying, account_type_u character varying, born_date_u date, weight_kg_u real, height_cm_u real, gioitinh_u boolean) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
	User_Id_U integer;
	vc integer;
	Nutrients_N character varying;
	Re boolean;
BEGIN
	Re= true;

	If(Account_U Is null Or Account_U='' Or char_length(Account_U)<6 
		Or Hash_Pass_U Is null Or Hash_Pass_U='' 
		Or Account_Type_U Is null Or Account_Type_U='' 
		Or Weight_kg_U<=0 Or Height_cm_U<=0) Then
		Re= false;
		RETURN Re;
	End If;

	vc=(Select count(*) From "User" Where "Account"=Account_U);
	If (vc>0) Then
		Re= false;
		RETURN Re;
	End If;
	
	User_Id_U= 1;
	vc= (Select count(*) From "User" Where "User_Id"=User_Id_U);
	While(vc>0)
	  Loop
		User_Id_U= User_Id_U + 1;
		vc= (Select count(*) From "User" Where "User_Id"=User_Id_U);
	  End Loop;

	RETURN Re;
END
$$;


