-- Name: updatedish(integer, smallint, real); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.updatedish(dish_id_u integer, nutrients_id_u smallint, value_nutrients_dish_u real) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	DF_DN_Id bigint;
BEGIN
	vc= (Select count(*) From "Nutrients" Where "Nutrients_Id"=Nutrients_Id_U);
	If(vc>0) Then
		vc=(Select count(*) From "Dish_Nutrients" Where "Dish_Id"=Dish_Id_U and "Nutrients_Id"=Nutrients_Id_U);
		If(vc>0 and Value_Nutrients_Dish_U Is Not null) Then
			Update "Dish_Nutrients" Set "Value_Nutrients_Dish"=Value_Nutrients_Dish_U
				Where "Dish_Id"=Dish_Id_U and "Nutrients_Id"=Nutrients_Id_U;
		Else
			vc=(Select count(*) From "Dish" Where "Dish_Id"=Dish_Id_U);
			If(vc>0 and Value_Nutrients_Dish_U Is Not null) Then
				DF_DN_Id= 1;
				vc= (Select count(*) From "Dish_Nutrients" Where "Dish_Nutrients_Id"=DF_DN_Id);
				While(vc>0)
				  Loop
					DF_DN_Id= DF_DN_Id + 1;
					vc= (Select count(*) From "Dish_Nutrients" Where "Dish_Nutrients_Id"=DF_DN_Id);
				  End Loop;
			End If;
		End If;

	End If;
	
END
$$;


