CREATE FUNCTION public.updatefood(food_id_u integer, nutrients_id_u smallint, value_nutrients_food_u real) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	vc integer;
	DF_DN_Id bigint;
BEGIN
	vc= (Select count(*) From "Nutrients" Where "Nutrients_Id"=Nutrients_Id_U);
	If(vc>0) Then
		vc=(Select count(*) From "Food_Nutrients_100g" Where "Food_Id"=Food_Id_U and "Nutrients_Id"=Nutrients_Id_U);
		If(vc>0 and Value_Nutrients_Food_U Is Not null) Then
			Update "Food_Nutrients_100g" Set "Value_Nutrients_in100g_Food"=Value_Nutrients_Food_U
				Where "Food_Id"=Food_Id_U and "Nutrients_Id"=Nutrients_Id_U;
		Else
			vc=(Select count(*) From "Food" Where "Food_Id"=Food_Id_U);
			If(vc>0 and Value_Nutrients_Food_U Is Not null) Then
				DF_DN_Id= 1;
				vc= (Select count(*) From "Food_Nutrients_100g" Where "Food_Nutrients_100g_Id"=DF_DN_Id);
				While(vc>0)
				  Loop
					DF_DN_Id= DF_DN_Id + 1;
					vc= (Select count(*) From "Food_Nutrients_100g" Where "Food_Nutrients_100g_Id"=DF_DN_Id);
				  End Loop;
			End If;
		End If;

	End If;
	
END
$$;


